var getAll = function() {
  return events;
};

var get = function(eventId) {
  for(var f in events)
  {
    if(events[f].id == eventId) return events[f];
  }
};

var save = function(eventDTO) {
  var event = fromDTO(eventDTO);
  events.push(event);
};

module.exports = {
  getAll: getAll,
  get: get,
  save: save,

  class: Event,
  fromDTO: fromDTO,
  EVENT_STATUS: EVENT_STATUS
};